    [],nt"revision_timestamp": "2016-04-26T01:12:22.651562",nt"name": "field-support-system",nt"isopen":
    true,nt"url": null,nt"notes": "The Field Support System (FS-AID) and Working
    Capital Fund Tracking System (WCF-TS) are two modules of a single data management
    system that share common tables and functions while performing related but distinct
    tasks.  FS-AID users plan and track mission funds that are to be placed into specific
    pillar bureau-managed agreements. Missions plan their field support requests; pillar
    bureaus gather requests from clients in the field and initiate work planning for
    each agreement.  Missions and Pillar Bureaus can view all field support plans, commitments
    and obligations in one table/system for easy access to track funds status.  WCF-TS
    tracks select HIV/AIDS funding from the Office of the U.S. Global AIDS Coordinator
    (OGAC) that is managed by the Global Health Bureau on behalf of the Global Health
    Bureau, PEPFAR (President's Emergency Plan for AIDS Relief), and Missions in Africa,
    Asia, and Latin America.",nt"license_title": "Other License Specified",nt"extras":
